import React from 'react';

function QuestionCard({ questions }) {
  const { data } = props;


  return data.map(({ text, answer }) => (
    <div key={Math.random()} >
      <p>{text}</p>
      <p>{answer.toString()}</p>
    </div>
  ));
}

export default QuestionCard
